selector_to_html = {"a[href=\"#exampleAD2\"]": "<div class=\"code_example dropdown admonition\" id=\"exampleAD2\">\n<p class=\"admonition-title\">Code Example: Basic Class Example </p>\n<section id=\"code_example-content\">\n<p>An example of a derived class:</p>\n<div class=\"cell tag_remove-output tag_skip-execution docutils container\">\n<div class=\"cell_input docutils container\">\n<div class=\"highlight-C++ notranslate\"><div class=\"highlight\"><pre><span></span><span class=\"cp\">#include</span><span class=\"w\"> </span><span class=\"cpf\">&lt;iostream&gt;</span>\n<span class=\"cp\">#include</span><span class=\"w\"> </span><span class=\"cpf\">&lt;string&gt;</span>\n\n<span class=\"k\">class</span><span class=\"w\"> </span><span class=\"nc\">Person</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"k\">protected</span><span class=\"o\">:</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"w\"> </span><span class=\"n\">name</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">age</span><span class=\"p\">;</span>\n<span class=\"k\">public</span><span class=\"o\">:</span>\n<span class=\"w\">    </span><span class=\"n\">Person</span><span class=\"p\">(</span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"w\"> </span><span class=\"n\">init_name</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">init_age</span><span class=\"p\">)</span><span class=\"w\"> </span><span class=\"o\">:</span><span class=\"w\"> </span><span class=\"n\">name</span><span class=\"p\">(</span><span class=\"n\">init_name</span><span class=\"p\">),</span><span class=\"w\"> </span><span class=\"n\">age</span><span class=\"p\">(</span><span class=\"n\">init_age</span><span class=\"p\">)</span><span class=\"w\"> </span><span class=\"p\">{}</span><span class=\"w\"> </span><span class=\"c1\">// Constructor</span>\n<span class=\"w\">    </span><span class=\"kt\">void</span><span class=\"w\"> </span><span class=\"n\">displayInfo</span><span class=\"p\">()</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">        </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"Name: \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">name</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"</span><span class=\"se\">\\n</span><span class=\"s\">Age: \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">age</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"sc\">'\\n'</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"p\">}</span>\n<span class=\"p\">};</span>\n<span class=\"k\">class</span><span class=\"w\"> </span><span class=\"nc\">Student</span><span class=\"w\"> </span><span class=\"o\">:</span><span class=\"w\"> </span><span class=\"k\">public</span><span class=\"w\"> </span><span class=\"n\">Person</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"k\">private</span><span class=\"o\">:</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"w\"> </span><span class=\"n\">studentID</span><span class=\"p\">;</span>\n<span class=\"k\">public</span><span class=\"o\">:</span>\n<span class=\"w\">    </span><span class=\"c1\">// Constructor using base class constructor</span>\n<span class=\"w\">    </span><span class=\"n\">Student</span><span class=\"p\">(</span><span class=\"w\"> </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"w\"> </span><span class=\"n\">init_name</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">init_age</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"k\">const</span><span class=\"w\"> </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"o\">&amp;</span><span class=\"w\"> </span><span class=\"n\">init_studentID</span><span class=\"w\"> </span><span class=\"p\">)</span>\n<span class=\"w\">        </span><span class=\"o\">:</span><span class=\"w\"> </span><span class=\"n\">Person</span><span class=\"p\">(</span><span class=\"n\">init_name</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"n\">init_age</span><span class=\"p\">),</span><span class=\"w\"> </span><span class=\"n\">studentID</span><span class=\"p\">(</span><span class=\"n\">init_studentID</span><span class=\"p\">)</span><span class=\"w\"> </span><span class=\"p\">{}</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"w\"> </span><span class=\"n\">printStudentID</span><span class=\"p\">()</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">        </span><span class=\"k\">return</span><span class=\"w\"> </span><span class=\"n\">studentID</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"p\">}</span>\n<span class=\"p\">};</span>\n\n<span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"nf\">main</span><span class=\"p\">()</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">    </span><span class=\"n\">Person</span><span class=\"w\"> </span><span class=\"n\">person</span><span class=\"p\">(</span><span class=\"s\">\"Alice\"</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"mi\">21</span><span class=\"p\">);</span><span class=\"w\">  </span><span class=\"c1\">//Create instance of Person</span>\n<span class=\"w\">    </span><span class=\"n\">person</span><span class=\"p\">.</span><span class=\"n\">displayInfo</span><span class=\"p\">();</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"</span><span class=\"se\">\\n</span><span class=\"s\">\"</span><span class=\"p\">;</span>\n\n<span class=\"w\">    </span><span class=\"n\">Student</span><span class=\"w\"> </span><span class=\"n\">student</span><span class=\"p\">(</span><span class=\"s\">\"Bob\"</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"mi\">20</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"s\">\"F123456\"</span><span class=\"p\">);</span><span class=\"w\"> </span><span class=\"c1\">// Create an instance of Student</span>\n<span class=\"w\">    </span><span class=\"n\">student</span><span class=\"p\">.</span><span class=\"n\">displayInfo</span><span class=\"p\">();</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"ID: \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">student</span><span class=\"p\">.</span><span class=\"n\">printStudentID</span><span class=\"p\">();</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"</span><span class=\"se\">\\n</span><span class=\"s\">\"</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"k\">return</span><span class=\"w\"> </span><span class=\"mi\">0</span><span class=\"p\">;</span>\n<span class=\"p\">}</span>\n</pre></div>\n</div>\n</div>\n</div>\n<div class=\"code_explanation dropdown admonition\" id=\"explanationAD2\">\n<p class=\"admonition-title\">Explanation of  <a class=\"reference internal\" href=\"#exampleAD2\"> Code Example: Basic Class Example </a></p>\n<section id=\"code_explanation-content\">\n<p>Every instance of the derived class <code class=\"docutils literal notranslate\"><span class=\"pre\">Student</span></code> also has the data members called <code class=\"docutils literal notranslate\"><span class=\"pre\">name</span></code> and <code class=\"docutils literal notranslate\"><span class=\"pre\">age</span></code> that were inherited from the base class <code class=\"docutils literal notranslate\"><span class=\"pre\">Person</span></code>.</p>\n<p>Note: there is no constructor, or setter\u2019s for the person class, so not much can be done with it.</p>\n</section>\n</div>\n</section>\n</div>", "a[href=\"#exampleAD1\"]": "<div class=\"code_example dropdown admonition\" id=\"exampleAD1\">\n<p class=\"admonition-title\">Code Example: Basic Class Example </p>\n<section id=\"code_example-content\">\n<p>An example of a derived class:</p>\n<div class=\"cell tag_remove-output tag_skip-execution docutils container\">\n<div class=\"cell_input docutils container\">\n<div class=\"highlight-C++ notranslate\"><div class=\"highlight\"><pre><span></span><span class=\"cp\">#include</span><span class=\"cpf\">&lt;iostream&gt;</span>\n<span class=\"cp\">#incldue&lt;string&gt;</span>\n<span class=\"k\">class</span><span class=\"w\"> </span><span class=\"nc\">Person</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"k\">protected</span><span class=\"o\">:</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"w\"> </span><span class=\"n\">name</span><span class=\"p\">{};</span>\n<span class=\"w\">    </span><span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">age</span><span class=\"p\">{};</span>\n<span class=\"k\">public</span><span class=\"o\">:</span>\n<span class=\"w\">    </span><span class=\"kt\">void</span><span class=\"w\"> </span><span class=\"n\">displayInfo</span><span class=\"p\">()</span><span class=\"w\"> </span><span class=\"k\">const</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">        </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"Name: \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">name</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"</span><span class=\"se\">\\n</span><span class=\"s\">Age: \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">age</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"sc\">'\\n'</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"p\">}</span>\n<span class=\"p\">};</span>\n<span class=\"k\">class</span><span class=\"w\"> </span><span class=\"nc\">Student</span><span class=\"w\"> </span><span class=\"o\">:</span><span class=\"w\"> </span><span class=\"k\">public</span><span class=\"w\"> </span><span class=\"n\">Person</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"k\">private</span><span class=\"o\">:</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"w\"> </span><span class=\"n\">studentID</span><span class=\"p\">;</span>\n<span class=\"k\">public</span><span class=\"o\">:</span>\n<span class=\"w\">    </span><span class=\"n\">Student</span><span class=\"p\">(</span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"w\"> </span><span class=\"n\">init_name</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">init_age</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"w\"> </span><span class=\"n\">init_studentID</span><span class=\"p\">)</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">        </span><span class=\"n\">name</span><span class=\"w\"> </span><span class=\"o\">=</span><span class=\"w\"> </span><span class=\"n\">init_name</span><span class=\"p\">;</span><span class=\"w\"> </span><span class=\"n\">age</span><span class=\"w\"> </span><span class=\"o\">=</span><span class=\"w\"> </span><span class=\"n\">init_age</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"n\">studentID</span><span class=\"w\"> </span><span class=\"o\">=</span><span class=\"w\"> </span><span class=\"n\">init_studentID</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"p\">}</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"w\"> </span><span class=\"n\">printStudentID</span><span class=\"p\">()</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">        </span><span class=\"k\">return</span><span class=\"w\"> </span><span class=\"n\">studentID</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"p\">}</span>\n<span class=\"p\">};</span>\n<span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"nf\">main</span><span class=\"p\">()</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">    </span><span class=\"n\">Student</span><span class=\"w\"> </span><span class=\"n\">student</span><span class=\"p\">{</span><span class=\"w\"> </span><span class=\"s\">\"Bob\"</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"mi\">20</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"s\">\"F123456\"</span><span class=\"w\"> </span><span class=\"p\">};</span><span class=\"w\"> </span><span class=\"c1\">// Create an instance of Student</span>\n<span class=\"w\">    </span><span class=\"n\">student</span><span class=\"p\">.</span><span class=\"n\">displayInfo</span><span class=\"p\">();</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"ID: \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">student</span><span class=\"p\">.</span><span class=\"n\">printStudentID</span><span class=\"p\">();</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"</span><span class=\"se\">\\n</span><span class=\"s\">\"</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"k\">return</span><span class=\"w\"> </span><span class=\"mi\">0</span><span class=\"p\">;</span>\n<span class=\"p\">}</span>\n</pre></div>\n</div>\n</div>\n</div>\n<div class=\"code_explanation dropdown admonition\" id=\"explanationAD1\">\n<p class=\"admonition-title\">Explanation of  <a class=\"reference internal\" href=\"#exampleAD1\"> Code Example: Basic Class Example </a></p>\n<section id=\"code_explanation-content\">\n<p>Every instance of the derived class <code class=\"docutils literal notranslate\"><span class=\"pre\">student</span></code> also has data members called <code class=\"docutils literal notranslate\"><span class=\"pre\">name</span></code> and <code class=\"docutils literal notranslate\"><span class=\"pre\">age</span></code> that were inherited from</p>\n<p>Note: there is no constructor, or setter\u2019s for the person class, so not much can be done with it.</p>\n</section>\n</div>\n</section>\n</div>", "a[href=\"#virtual-functions\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Virtual Functions<a class=\"headerlink\" href=\"#virtual-functions\" title=\"Permalink to this heading\">#</a></h2><p>Virtual member functions allow the programmer to declare functions in a base class that can be redefined in each derived class.</p><p>Declaring a particular function as <code class=\"docutils literal notranslate\"><span class=\"pre\">virtual</span></code> in the base class allows that function identifier to act as an interface to the definitions of the function in both the base and derived classes. The compiler and linker will guarantee the correct correspondence between objects and the functions applied to them.</p>", "a[href=\"#inheritance-derived-classes\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Inheritance - Derived Classes<a class=\"headerlink\" href=\"#inheritance-derived-classes\" title=\"Permalink to this heading\">#</a></h1><p>A <strong>derived class</strong> (or sub-class) is a new class that inherits properties from a <strong>base Class</strong>.</p><p>Classes are described as base classes (or super-classes) when other classess are derived from them.</p>", "a[href=\"#more-on-access-specifiers\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">More on Access Specifiers<a class=\"headerlink\" href=\"#more-on-access-specifiers\" title=\"Permalink to this heading\">#</a></h2><p>The access specifier <code class=\"docutils literal notranslate\"><span class=\"pre\">protected</span></code> indicates that the data members may only used by the class and by classes derived from it.</p><p>Using the <code class=\"docutils literal notranslate\"><span class=\"pre\">public</span></code> access modifier for the derived class maintains the same access level for inheritable members of the base class. Any accessible members of the base class, i.e.  <code class=\"docutils literal notranslate\"><span class=\"pre\">public</span></code> or <code class=\"docutils literal notranslate\"><span class=\"pre\">protected</span></code> data members or member functions, become private members of the derived class. Since we want to call the member function <code class=\"docutils literal notranslate\"><span class=\"pre\">dispayInfo()</span></code> we need to make the derived class from a public declared base class.</p>", "a[href=\"#override\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Override<a class=\"headerlink\" href=\"#override\" title=\"Permalink to this heading\">#</a></h2><p><code class=\"docutils literal notranslate\"><span class=\"pre\">override</span></code> is used to designate a member function that overrides a virtual function in a base class.</p><p><code class=\"docutils literal notranslate\"><span class=\"pre\">override</span></code> is a reserved keyword when used immediately after a member function declaration.</p>", "a[href=\"#virtual-destructors\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Virtual Destructors<a class=\"headerlink\" href=\"#virtual-destructors\" title=\"Permalink to this heading\">#</a></h2><p>Destructors can be virutal - best practice is to make the base destructor virtual in any case involving polymorphism.</p><p>If a virtual function is used anywhere in the class hierarchy a virtual destructor should be added to prevent memory leaks.</p>", "a[href=\"#constructor-chaining\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Constructor Chaining<a class=\"headerlink\" href=\"#constructor-chaining\" title=\"Permalink to this heading\">#</a></h2>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false, theme: 'material', duration: [200, 100], delay: [200, 0],

            });
        };
    };
    console.log("tippy tips loaded!");
};
